import React from 'react'
import './styles/output.css';
import Layout from './pages/studentModule/Layout.jsx'
import A from './pages/studentModule/Layout.jsx'
import Login from './pages/loginRegister/Login';
import { BrowserRouter as Router,Route,Switch } from 'react-router-dom';
import Register from './pages/loginRegister/Register'
import Home from './pages/layout/Home.jsx';
// import { BrowserRouter ,Routes,Route} from 'react-router-dom';
function App() {
  return (
    <div>
    <Home />
    <Layout />
    <Switch>
                    <Route path='/Login' exact component={Login}/>
                    <Route path='/Register' component={Register}/>
                    <Route path='/Dashboard' component={Dashboard}/>
                    <Route path='/makeComplaint' component={MakeComplaint}/>
                    <Route path='/complaintHistory' component={ComplaintHistory}/>
                    <Route path='/feedback' component={Feedback}/>
                    <Route path='/accountSetting' component={AccountSetting}/>

    </Switch>
    </div> 
  );
}

export default App;
